Welcome to another episode of Talking With Tour Mouth Full, presented by @Butcher_Box. We are giving away a standard-sized ButcherBox ($129 – 5 cuts) + the promo Meat-Lovers Bundle (pork butt, ground beef and chicken thighs) to THREE well-fed friends for submitting questions to this episode. I’ll soon be sharing this dayummmm good Moroccan Spiced Pork Butt recipe in the next few days. As always, thanks for joining and listening to my ramblings between bites!! 

